window.bookSummaryJSON = "<p>They tried to break us.</p> <p>They almost did.</p> <p>But we're not going anywhere.&nbsp;&nbsp;</p> <p>The Celestial Heirs think the stars are on their side. But they don't know what's coming. We have to be smart. Fighting them one on one isn't an option, so we have to be stealthy. Remaining under the radar won't be easy, but if we pull it off, they'll never suspect our involvement when their lives start falling apart.&nbsp;&nbsp;</p> <p>Besides, they've already taken us to the brink of hell, what more can they really do?</p>"; 
